import React from 'react';
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn
} from 'mdb-react-ui-kit';

export default function App() {
  return (
    <div class="col-lg-12">
    <div style="margin: 10px 0 0 0">
        <div style="display:block"
            class="form-group nomarginall oa-lot-banner-status lot_c3fed8ea-4993-42b1-8068-f5e8e08556d8_banner_nobids">
            <div class="input-group" style="width: 100%">
                <div class="alert alert-info nomarginall oa-no-bids-for-user" style="padding: 8px 12px">
                    <span class="glyphicon glyphicon-unchecked"></span>
                    Login to see Bid Status
                </div>
            </div>
        </div>

    </div>
</div>
  );
}
